window.bookSummaryJSON = "<p><i>Her family, gone, destroyed from within</i><br> <i>Her kingdom, doomed, tainted by blood</i><br> <i>Unless a scion rises to become something… more</i><br> <br> In a single ruthless blow, Commander Lorraine Adamant’s favorite uncle murders <i>everyone</i> ahead of him in the succession for the Star Kingdom of Adamant. Only luck and the paranoia of her bodyguard, Vigo Jarret, saves Lorraine’s life.<br> <br> On the run in a single starship Lorraine should never have commanded, with a crew she can not trust, she swiftly learns her uncle’s hounds are hot on her heels. She must gather every skill, every trick, she has ever learned if she is to survive—and pray the uncle who <i>taught </i>her those tricks is a step behind.<br> <br> Because one thing is certain: Lorraine Adamant will save her Kingdom—or die.</p>"; 
